        static string RandomString(int length)
        {
            const string chars = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789-_+()!@#$%^&*\\/                ";
            return new string(Enumerable.Repeat(chars, length)
                .Select(s => s[random.Next(s.Length)]).ToArray());
        }

        [Benchmark]
        public int GetMinimumPenaltyWithArrayPool()
        {
            var a = this.firstStr;
            var b = this.secondStr;

            var pxy = 3;
            var pgap = 2;

            return GetMinimumPenalty(a.AsSpan(), b.AsSpan(), pxy, pgap);
        }

        [Benchmark]
        public int GetMinimumPenaltyUnoptimized()
        {
            var a = this.firstStr;
            var b = this.secondStr;

            var pxy = 3;
            var pgap = 2;

            return GetMinimumPenaltyUnopt(a, b, pxy, pgap);
        }

        public int GetMinimumPenaltyUnopt(string x, string y, int pxy, int pgap)
        {
            int i, j; // initialising variables

            int m = x.Length; // length of gene1
            int n = y.Length; // length of gene2

            // table for storing optimal substructure answers
            int[,] dp = new int[n + m + 1, n + m + 1];
            for (int q = 0; q < n + m + 1; q++)
            for (int w = 0; w < n + m + 1; w++)
                dp[q, w] = 0;

            // initialising the table 
            for (i = 0; i <= (n + m); i++)
            {
                dp[i, 0] = i * pgap;
                dp[0, i] = i * pgap;
            }

            // calculating the minimum penalty
            for (i = 1; i <= m; i++)
            {
                for (j = 1; j <= n; j++)
                {
                    if (x[i - 1] == y[j - 1])
                    {
                        dp[i, j] = dp[i - 1, j - 1];
                    }
                    else
                    {
                        dp[i, j] = Math.Min(Math.Min(dp[i - 1, j - 1] + pxy,
                                dp[i - 1, j] + pgap),
                            dp[i, j - 1] + pgap);
                    }
                }
            }

            return m + n;
        }

        [Benchmark]
        public int GetMinimumPenaltyWithArrayPoolAndEarlyPoolReturns()
        {
            var pxy = 3;
            var pgap = 2;

            return GetMinimumPenaltyOptimizedMem(firstStr.AsSpan(), secondStr.AsSpan(), pxy, pgap);
        }

        public int GetMinimumPenalty(ReadOnlySpan<char> x, ReadOnlySpan<char> y, int pxy = 3, int pgap = 2)
        {
            var n = y.Length;
            var m = x.Length;

            var dp = ArrayPool<int[]>.Shared.Rent(n + m + 1);
            for (int i = 0; i < n + m + 1; i++)
            {
                dp[i] = ArrayPool<int>.Shared.Rent(n + m + 1);
            }

            for (var i = 0; i <= (n + m); i++)
            {
                dp[i][0] = i * pgap;
                dp[0][i] = i * pgap;
            }

            for (var i = 1; i <= m; i++)
            {
                for (var j = 1; j <= n; j++)
                {
                    var z = dp[i - 1][j - 1];
                    dp[i][j] = z;
                    if (x[i - 1] == y[j - 1]) continue;

                    var a = z + pxy;
                    var b = dp[i - 1][j] + pgap;
                    var c = dp[i][j - 1] + pgap;
                    dp[i][j] = Math.Min(Math.Min(a, b), c);
                }
            }

            var ret = dp[m][n];

            for (int i = 0; i < n + m + 1; i++)
            {
                ArrayPool<int>.Shared.Return(dp[i], false);
            }

            ArrayPool<int[]>.Shared.Return(dp, false);
            return ret;
        }

        public int GetMinimumPenaltyOptimizedMem(ReadOnlySpan<char> x, ReadOnlySpan<char> y, int pxy = 3, int pgap = 2)
        {
            var n = y.Length;
            var m = x.Length;
            var dp = ArrayPool<int[]>.Shared.Rent(m);
            // dp[0]..dp[1]
            for (int i = 0; i <= 1; i++)
            {
                dp[i] = ArrayPool<int>.Shared.Rent(n);
            }

            // initialize first row
            for (var i = 0; i <= n; i++)
            {
                dp[0][i] = i * pgap;
            }

            // initialize first two items from first column
            for (var i = 0; i <= 1; i++)
            {
                dp[i][0] = i * pgap;
            }

            for (var i = 1; i <= m; i++)
            {
                dp[i] = ArrayPool<int>.Shared.Rent(n);
                dp[i][0] = i * pgap;

                for (var j = 1; j <= n; j++)
                {
                    var z = dp[i - 1][j - 1];
                    dp[i][j] = z;
                    if (x[i - 1] == y[j - 1])
                        continue;
                    var a = z + pxy;
                    var b = dp[i - 1][j] + pgap;
                    var c = dp[i][j - 1] + pgap;
                    dp[i][j] = Math.Min(Math.Min(a, b), c);
                }

                if (i >= 2)
                {
                    ArrayPool<int>.Shared.Return(dp[i - 2]);
                }
            }

            var ret = dp[m][n];
            ArrayPool<int>.Shared.Return(dp[m]);
            if (m >= 1)
                ArrayPool<int>.Shared.Return(dp[m - 1]);

            ArrayPool<int[]>.Shared.Return(dp);
            return ret;
        }
    }

